import React from 'react'

class LoginPage extends Component {
	render() {
		return(
			<div>
			<h1>Login</h1>
			<form>
				<input type="text" name="email" placeholder="Email" />
				<input type="password" name="password" placeholder="Password"/>
			</form>
		</div>
		)
	}
}

export default LoginPage;
